import React from "react";

// React component
export default function HomeView() {
  return (
    <div className="home">
      <div class="list"> </div>
      <div class="head">
        <h1>LIST STYLE</h1>
        <hr />
      </div>

      <h1>HOME</h1>
      <ul className="home-ul">
        {/* <h2>React is great</h2> */}
        <li>
          <i className="fa fa-angle-right">
            {" "}
            It's popular library, so you'll be able to fit in with the cool kids
          </i>
        </li>
        <li>
          {" "}
          <i className="fa fa-angle-right">
            {" "}
            It's more likely to get a job as a developer if you know react.
          </i>
        </li>
        <li>
          {" "}
          <i className="fa fa-angle-right"> It's easy to use.</i>
        </li>
      </ul>
    </div>
  );
}
